import React from 'react';

function ServicesSection({image}) {
    return (
        <div className="ServicesSection">
            <div className="service">
                <img src={image} alt="" />
                <h5 className="s-title"></h5>
                <p className="s-text"></p>
            </div>
        </div>
    );
}

export default ServicesSection;
